import queue

class Solution:
    def canReach(self, s: str, minJump: int, maxJump: int) -> bool:
        n = len(s)
        hq = [0]
        jumps = defaultdict(int)
        for i in range(1,n):
            while hq and i-hq[0]>maxJump:
                heappop(hq)
            if s[i]=="0":
                for j in hq:
                    if minJump<=i-j<=maxJump:
                        heappush(hq,i)
                        jumps[i]=1
                        break
        return jumps[n-1]

    def canReach_2(self, s: str, minJump: int, maxJump: int) -> bool:
        n = len(s)
        jumps = [0]*n
        jumps[0]=1
        for i in range(1,n):
            if s[i]=="0":
                if any(jumps[i-maxJump:i-minJump+1]):
                    jumps[i]=1
        return jumps[-1]

    def canReach_1(self, s: str, minJump: int, maxJump: int) -> bool:
        n = len(s)
        jumps = defaultdict(int)
        jumps[0]=1
        for i in range(1,n):
            if s[i]=="0":
                for j in range(minJump,maxJump+1):
                    if 0<=i-j and jumps[i-j]:
                        jumps[i]=1
                        break
        return jumps[n-1]

